SELECT CUSTOMER.C_PHONE, NATION.N_COMMENT, ORDERS.O_COMMENT FROM NATION JOIN CUSTOMER ON CUSTOMER.C_NATIONKEY=NATION.N_NATIONKEY JOIN ORDERS ON ORDERS.O_CUSTKEY=CUSTOMER.C_CUSTKEY WHERE ORDERS.O_ORDERPRIORITY < '1-URGENT       ' AND NATION.N_NAME < '9297' AND NATION.N_NATIONKEY >= CIAL PACKAGES BOOST ALONG THE IDEAS. PACKAGES SLEEP SLYLY EXPRESS PACKAGES. IRONIC, BOLD REQUESTS ORDER BY ORDERS.O_COMMENT DESC, CUSTOMER.C_PHONE ASC, NATION.N_COMMENT ASC;
